Analyse des indicateurs d'égalité femme-homme

Ce Workflow permet :
- d'automatiser l'importation et la préparation des données source ;
- de générer un fichier CSV contenant ces données ;
- d'automatiser la création d'indicateurs destinés à alimenter un rapport sur l’égalité professionnelle femmes hommes.
